import paginaPrincipal from './paginas/pagina-principal';

function App() {
  return (
    <Provedor>
        <Routes path='/' Component={ paginaPrincipal } />
        <a>aaaaaaaaaaaaa</a>
    </Provedor>
  );
}

export default App;
